import {  useState } from 'react'
import './App.css';

function App() {
  console.log('вызов функции компонента')
  const [counter, setCounter] = useState(5)

  useEffect(() => {
    console.log('useEffect')
  }, [])

  const handlePlus = () => {
    setCounter(counter + 1)
  }

  return (
    <div>
      <span>{counter}</span>
      <button onClick={handlePlus}>+</button>
   </div>
  )
}

export default App
